import axios from "axios";
import { useEffect, useState } from "react"


function App() {

  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async()=> {
    const response = await axios.get("https://restcountries.com/v2/all")
    setData(response.data)
    }

    console.log(fetchData());
  }, []);

  return (
    <div className="App">
      <ul>
        {data.map((repo) => 
        <div key={repo.index} style={({display: 'flex', flex: 5,})}>
          <div>{repo.name}</div>

          <div style={({marginLeft: '100px',})}>{repo.capital}</div>
          <div>{repo.region}</div>
          <div>{repo.flag}</div>


        </div>

        )}
      </ul>
    </div>
  );
}

export default App;
